import React from "react";
import Logo from "./componentes/images/git-logo.png";

export default function App() {
 const nome = "Matheus";
 const idade = () => {
  return 19;
 }
 return (
  <>
   <p>Nome: {nome}</p>
   <p>Idade: {idade()}</p>

   <img src={Logo} />
   <img src="/ima" />
  </>
 )
}
